    {value: 3, name:"pop rap"},
  ]

const [count, setCount] = useState(0);


  return (
    <div className="App">
      <h1>genrerator</h1>
      <Dropdown options={data} />
      <p>you clicked {count} times</p>
      <button onClick={() => setCount(count + 1)}>
        click 
      </button>
    </div>
  );
}

